def is_divisible_by_8(n):
    return (5**(2*n) + 7) % 8 == 0

# Test cases
test_values = [-8, -4, 0, 4, 8]  # All values divisible by 4
results = {n: is_divisible_by_8(n) for n in test_values}
print(results)

def is_divisible_by_5(n):
    if (2 * n - 2) % 3 == 0:
        C = 7 * 2**(2 * n - 2) + 3**(2 * n - 1)
        return C % 5 == 0
    return False

# Test cases
test_values = [0, 1, 2, 3, 4, 5, 6]
results = {n: is_divisible_by_5(n) for n in test_values}
print(results)

def is_divisible_by_11(n):
    if (4 * n + 1) % 11 == 0:
        expression_value = 3**(2**(4*n+1)) + 2**(3**(4*n+1)) + 5
        return expression_value % 11 == 0
    return False

# Test with n = -2, which satisfies 4n+1 divisible by 11
n = -2
if is_divisible_by_11(n):
    print(f"For n = {n}, the expression is divisible by 11.")
else:
    print(f"For n = {n}, the expression is not divisible by 11.")

def is_divisible(n):
    A_n = 5**n * (5**n + 1) - 6**n * (3**n + 2**n)
    return A_n % 91 == 0

# Test for some values of n
for n in range(1, 10):
    print(f"n = {n}, A(n) divisible by 91: {is_divisible(n)}")

def is_divisible_by_19(n):
    expression = 7 * (5**(2*n)) + 12 * (6**n)
    return expression % 19 == 0

# Testing for several values of n
for n in range(1, 20):
    print(f"n = {n}, divisible by 19: {is_divisible_by_19(n)}")

def is_divisible_by_72(n):
    return (3**n + 63) % 72 == 0

# Test some values of n that are divisible by 6 and >= 2
test_values = [6, 12, 18, 24, 30]
results = {n: is_divisible_by_72(n) for n in test_values}
print(results)

def is_divisible_by_5(n):
    return (9**(2*n) + 14) % 5 == 0

# Test for some natural numbers not necessarily divisible by 4
for n in range(1, 10):
    print(f"n = {n}, divisible by 5: {is_divisible_by_5(n)}")

def is_divisible_by_9(n):
    if n % 3 == 0:
        expression_value = 4**n + 15*n - 1
        return expression_value % 9 == 0
    return False

# Test cases
test_values = [0, 3, 6, 9, 12]  # Values divisible by 3
results = {n: is_divisible_by_9(n) for n in test_values}
print(results)
